import React from 'react';
import { ToastContainer } from 'react-toastify';
import { Routes, Route } from 'react-router';
import './App.css';
import Navbar from './components/layout/Navbar';

const App = () => {
  return (
    <div className="App">
      <ToastContainer />
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
      <h1>Hello Word!</h1>
    </div>
  );
};

export default App;
